import React from 'react';
import './aboutus.css';
import Zoom from 'react-reveal/Zoom';

import { Button } from './Button';
import { Link } from 'react-router-dom';

function AboutUs() {
  return (
    <div className='fct'>
    
      <div className='fct__container'>
        <div className='fct__wrapper'>
        <Rotate top left>
        <h1>About us :)</h1>
                             </Rotate>
                             <Rotate topright>                    
        <ul className='ul'>
            
            <p></p>
        </ul>
        </Rotate>
    </div>
      </div>
    </div>
  );
}

export default AboutUs;
